import React from "react";

function Timer() {
  return (
    <div>
      <p style={{color:"#9F9F9F"}}> Timer</p>
      <p>
        <button> style={{color:"#9F9F9F"}} OFF</button>
      </p>
      <p>
        <button style={{color:"#9F9F9F"}}> 5 sec</button>
      </p>
      <p>
        <button style={{color:"#9F9F9F"}}> 10 sec</button>
      </p>
    </div>
  );
}

export default Timer;
